import React, { useState } from "react";
import MapSelector from "./components/MapSelector";
import ResultsPanel from "./components/ResultsPanel";

export default function App(){
  const [jobId, setJobId] = useState(null);
  return (
    <div className="app">
      <header className="header">
        <h1>SatSense — Change Detection</h1>
        <p className="muted">Select an area and date ranges, then run change detection (Sentinel-2 / Landsat-8)</p>
      </header>
      <main className="container">
        <div className="left">
          <MapSelector onJobCreated={(id)=>setJobId(id)} />
        </div>
        <div className="right">
          <ResultsPanel jobId={jobId} />
        </div>
      </main>
      <footer className="footer">SatSense • Demo</footer>
    </div>
  );
}
